import React from 'react';
import { Link } from 'react-router-dom';

function Home({ i18n }) {
  return (
    <div className="text-center">
      <h2 className="display-4 my-5">
        {i18n.home_title}
      </h2>


      <div className="d-flex justify-content-center gap-3">
        <Link 
          to="/services/workshop" 
          className="btn btn-primary btn-lg"
        >
          {i18n.workshop_button}
        </Link>
        <Link 
          to="/services/car-wash" 
          className="btn btn-secondary btn-lg"
        >
          {i18n.car_wash_button}
        </Link>
      </div>

      <div className="mt-5 border p-4 rounded bg-light text-start">
        <h3 className="h4">{i18n.chatbot_title}</h3>
        <p><strong>{i18n.user_label}:</strong> {i18n.user_greeting}</p>
        <p><strong>{i18n.bot_label}:</strong> {i18n.bot_greeting}</p>
      </div>
    </div>
  );
}

export default Home;
